import Vue from "vue";
import VueRouter from "vue-router";


import Homes from "./pages/Homes";



Vue.use(VueRouter);

export const routes = [
    { path: "/home", component: Homes, name: "home", meta: { requiresAuth: false } },

    //PAGE ORIENTATION
    { path: "*", redirect: "/" },
];




export const router = new VueRouter({
    mode: "history",
    routes,
});
